import './LoginPage.css';
import logo from '../files/logo_main.png';
import {React} from 'react';
import {useHistory} from "react-router-dom";

function handleSubmit (event) {
    event.preventDefault();

    consol.log(event.target);

    console.log("111 PASS - " + event.target.password);
    console.log("111 EMAIL - " + event.target.email);

    const data = new FormData(event.target);
    console.log(data);
    console.log("PASS - " + data.password);
    console.log("EMAIL - " + data.email);
    fetch('http://localhost:5000/Users/login', {
      method: 'POST',
      body: JSON.stringify({id:0, username:'', password:'', firstName:'', lastName:'', phone:'', email:'',linkedIn:'', gitHub:'',imagePath:'', bio:'',experience:'',skills:{}}),
    }).then(response => response.json()).then(responseJson =>  {

        console.log("huy " + responseJson);
        if(responseJson.status === 400)
            useHistory.push("/home");
        else
            alert("Wrong Password");
    });
} 

export const LoginPage = () => {

  return (
    <div className='columns'>
        <div className='row1'>
          
          <div className='logo-image'>
            <img src={logo} alt='Find-a-Bull logo'/>
          </div>
          <form onSubmit={handleSubmit} method='POST' action='http://localhost:5000/users/'>
            <div className='item login username'>
                <h2>Email:</h2>
                <input placeholder='your email adress' name="email" required></input>
            </div>

            <div className='item login password'>
                <h2>Password:</h2>
                <input placeholder='your password' name="password" type='password' required></input>
            </div>
            <div className='login'>
                <button type='submit' className="submit-button">Sign in</button>
            </div>
          </form>
        </div>
    </div>
  );
}
